Information
------------------------------

Man-Eating Super Croc
A legendary beast in a Filipino fishing community captured headlines when it reportedly killed and ate two of the villagers. On the Monster Week special &quot;Man-Eating Super Croc&quot; viewers were treated to never-before-seen footage of the beast as it was captured and transported to a sanctuary they'd constructed for it. After capture, the monster was measured at greater than 20 feet in length and more than 2,000 pounds. But perhaps more significantly, the crocodile was innocent. Experts pumped the crocodile's stomach and found no evidence of human remains. This crocodile didn't eat any villagers. But the drama wasn't over, as the villagers saw a second crocodile that appeared to be even larger than the one they'd captured. Perhaps this was the real killer. Maybe this croc's story will be spotlighted in a new special for next year's Monster Week.

